import React from 'react'
import Button from '../components/LoginInput'
import Style from '../CSS/styles.module.css'

const login = () => {
    const form = [
        { label: 'Phone Number', type: 'number' },
        { label: 'Password', type: 'text' },
    ]

    const allInput = form.map((item, index) => {
        return <Button item={item} key={index} />
    })
    return (
        <>
            <div className={Style.body}>
                <form>
                    <h1>Login</h1>
                    {allInput}
                    <button className={Style,Btn}>Login</button>
                </form>
            </div>
        </>
    )
}

export default login
